import React from 'react';
import Card from './card'

const Cardlist = ({Robots}) => {
    return (
        <div>
            {
                Robots.map((user, i) => {
                    return (
                        <Card
                            key={i}
                            id={Robots[i].id}
                            name={Robots[i].name}
                            email={Robots[i].email}
                            />
                    );
                })
            }
        </div>
    );
}

export default Cardlist
